import * as React from 'react';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { DateCalendar } from '@mui/x-date-pickers/DateCalendar';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { DemoContainer, DemoItem } from '@mui/x-date-pickers/internals/demo';
import { ReactComponent as OrangeDot } from "../../assets/orange dot.svg";
import dayjs from 'dayjs';
import { Typography } from '@mui/material';
import styled from "styled-components";
import Divider from '@mui/material/Divider';
import CardContent from '@mui/material/CardContent';
import Card from '@mui/material/Card';
import { ReactComponent as BlueLine } from "../../assets/blue line.svg";

const StyledRemiderContainer = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  gap: 0.5rem;

`
const StyledCaseContainer = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: left;
  align-items: left;
  gap: 6px;

`
const StyledTypoContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: left;
  align-items: left;
  gap: 4px;

`
const BasicTabs= () => {
  const [value, setValue] = React.useState('1');

  const handleChange = (event: React.SyntheticEvent, newValue: string) => {
    setValue(newValue);
  };

  return (
    <Box sx={{ width: '100%', typography: 'body1' }}>
      <TabContext value={value}>
        <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
          <TabList onChange={handleChange} aria-label="lab API tabs example">
            <Tab label="Team" value="1" />
            <Tab label="Me" value="2" />
            {/* <Tab label=" " value="3" /> */}
          </TabList>
        </Box>

        <TabPanel value="1">
        <LocalizationProvider dateAdapter={AdapterDayjs}>
        <DemoContainer components={['DateCalendar']}>
        <DateCalendar defaultValue={dayjs(new Date().toISOString().substring(0, 10))} readOnly />
        </DemoContainer>
        </LocalizationProvider>
        <StyledRemiderContainer>
        <OrangeDot/>
        <Typography mt={3} padding={0} margin={0} >You have a total of 5 overdue cases.</Typography>
        </StyledRemiderContainer>
        <Box sx={{ p: 2 }}>
        <Divider />


        <Card sx={{ borderRadius: '8px', border: 2, borderColor: '#F3F3F3', boxShadow: 0 , width: 280, minWidth: 50, minHeight: 10,position: 'absolute',
    top: 540,
    left: '15%',
     }}

     >
      <CardContent sx={{ pt:2, pb:2, pr:2, pl: 2}}>
      <StyledCaseContainer>
        <BlueLine/>
        <StyledTypoContainer>
        <Typography sx={{ fontSize: 12, fontWeight:500 }} color="#333D47" margin={0} gutterBottom>
        Case Transferred from CMIS
        </Typography>
        <Typography sx={{ fontSize: 12, fontWeight:300 }} color="#848A90" margin={0} gutterBottom>
        2 Aug 2025, RNK23600888
        </Typography>
        </StyledTypoContainer>
        </StyledCaseContainer>
        </CardContent>
    </Card>

    <Card sx={{ borderRadius: '8px', border: 2, borderColor: '#F3F3F3', boxShadow: 0 , width: 280, minWidth: 50, minHeight: 10,position: 'absolute',
    top: 540,
    left: '15%',
     }}

     >
      <CardContent sx={{ pt:2, pb:2, pr:2, pl: 2}}>
      <StyledCaseContainer>
        <BlueLine/>
        <StyledTypoContainer>
        <Typography sx={{ fontSize: 12, fontWeight:500 }} color="#333D47" margin={0} gutterBottom>
        Case Transferred from CMIS
        </Typography>
        <Typography sx={{ fontSize: 12, fontWeight:300 }} color="#848A90" margin={0} gutterBottom>
        2 Aug 2025, RNK23600888
        </Typography>
        </StyledTypoContainer>
        </StyledCaseContainer>
        </CardContent>
    </Card>

        </Box>
        </TabPanel>
        <TabPanel value="2">Item Two</TabPanel>
        {/* <TabPanel value="3"></TabPanel> */}
      </TabContext>
    </Box>
  );
};

export default BasicTabs;
